import React, { useState } from 'react';

function AdminUpdate() {
  // Define state for form values
  const [formValues, setFormValues] = useState({
    name: '',
    email: '',
    oldPassword: '',
    newPassword: '',
    confirmPassword: ''
  });

  // Function to handle form submission
  function handleSubmit(event) {
    event.preventDefault();
    // Here you can perform form submission logic
    console.log('Form submitted:', formValues);
    // Reset form values after submission
    setFormValues({
      name: '',
      email: '',
      oldPassword: '',
      newPassword: '',
      confirmPassword: ''
    });
  }

  // Function to handle input changes
  function handleChange(event) {
    const { name, value } = event.target;
    setFormValues({
      ...formValues,
      [name]: value
    });
  }

  return (
    <div>
      {/* Your header and side bar code */}
      <section className="form-container">
        <form onSubmit={handleSubmit} method="post" encType="multipart/form-data">
          <h3>update profile</h3>
          <p>update name</p>
          <input
            type="text"
            name="name"
            placeholder="Raj"
            maxLength="50"
            className="box"
            value={formValues.name}
            onChange={handleChange}
          />
          {/* Repeat similar input elements for other fields */}
          <input type="submit" value="update profile" name="submit" className="btn" />
        </form>
      </section>
    </div>
  );
}

export default AdminUpdate;
